import { Button } from '@arbete/ui';
import AuthProvider, { AuthConsumer } from 'contexts/Auth';

export default function Index() {
  return (
    <>
      <AuthProvider>
        <p>Hello Next.js</p>
        <AuthConsumer>
          { ({login, logout, token }) => <>
            { token }
            <Button onClick={login}>Login</Button>
            <Button onClick={logout}>Logout</Button>
          </>}
        </AuthConsumer>
      </AuthProvider>
    </>
  );
}
